import 'react-native-gesture-handler';
import React from 'react';
import { 
	StyleSheet, 
	Text, 
	Button, 
	View,
	SafeAreaView, 
	TouchableOpacity 
} from 'react-native';

export default class ExersiceScreen extends React.Component {
	render() {
		// const { name } = this.props.route.params; // Get name from params which comes from the navigate function from LogIn.js
		const { navigate } = this.props.navigation
		return (
			<SafeAreaView style={styles.container}>
				<Text>
					Exercise
				</Text>
				<Exercise
					navigation={this.props.navigation}
				/>
			</SafeAreaView>
		)
	}
}

class Exercise extends React.Component {
	render() {
		return (
			<View style={styles.view}>
        <TouchableOpacity
          style={styles.journeyButton}>
          <Text>Begin Exercise</Text>
        </TouchableOpacity>
      </View>
		);
	}
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center'
  },
  view: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  },
  journeyButton: {
    width: 200,
    marginRight: 40,
    marginLeft: 40,
    marginTop: 10,
    paddingTop: 10,
    paddingBottom: 10,
    backgroundColor: '#42A5F5',
    borderRadius: 10,
    borderWidth: 2,
    borderColor: '#fff',
    alignItems: 'center'
  }
})
